import React, {useState} from 'react';
import '../styles/navbar.css';
import '../styles/logo.css';
import logo from "../images/logo.png"

function Navbar() {

    return ( 
        <div className = "nav">
            <div className = "leftSide">
                <img src = {logo}/>

            </div>
            <div className = "rightSide">

            </div>
        </div>
     );
}

export default Navbar;
